import Navigation from "../components/Navigation";
import Container from "../components/Container";
import Head from "next/head";

export default function Index() {
  return (
    <>
      <Head>
        <title>Home - Nextjs</title>
      </Head>
      <Container>
        <h1>Hello World</h1>
      </Container>
    </>
  );
}
